6.4	CAPACITY RELEASE

	Any Customer under Rate Schedules FSS may seek to release for assignment to others any or all of its firm storage service entitlements on:
(a) a full Day or an intraday basis,
(b) a permanent or a temporary basis, and
(c) a firm or recallable basis, subject to the following terms and conditions:
6.4.1	Notice of Offer. A Customer offering to release firm storage service entitlements shall notify MS HUB via its Internet Web Site of the terms of its offer by the posting deadline as determined pursuant to Section 6.4.3 of these General Terms and Conditions. This information will be posted on MS HUB's Internet Web Site. Customer may propose a prearranged designated Replacement Customer to which the capacity would be released. Offers shall be binding unless written or electronic notice of withdrawal is received by MS HUB prior to the close of the applicable bid period; provided, however, such withdrawal shall only be valid if such Customer has an unanticipated requirement for such capacity and no minimum bid has been made. The notice must contain the reason for withdrawal, which MS HUB shall post on its Internet Web Site. The offer shall contain the following minimum information:
(a) Customer's legal name and the name/title of individual who has authorized the offer to release;
(b) MS HUB's Storage Service Agreement number;
(c) A description of the capacity to be released, including the MSQ, the MDIQ, and the MDWQ, and the associated Point(s) of Receipt and Point(s) of Delivery (Replacement Customer may request changes to such Point(s) of Receipt and Point(s) of Delivery subject to the proposed release and subject to the daily quantity limitations described in Section 6.4.2 of these General Terms and Conditions);
(d) The proposed effective date and term of the release;
(e) The identity of any pre-arranged designated Replacement Customer and the full terms of such pre-arranged release;
(f) The method to be applied in evaluating bids, allocating capacity and breaking ties, as described below;
(g) Whether, to what extent, and the conditions pursuant to which capacity will be subject to recall for a full Day or a partial Day; if recallable, whether the Releasing Customer's recall notification must be provided exclusively on a Business Day, and any reput methods and rights associated with returning the previously released capacity to the Replacement Customer;
(h) Whether bids on a volumetric rate basis may be submitted, and, if so, the method for evaluating any such bids, including how to rank bids if bids are also to be accepted on a reservation charge basis, and any other special conditions;
(i) Whether contingent bids that extend beyond the bid period may be submitted, how to evaluate and prioritize such bids against non- contingent bids, and the terms and conditions under which, and/or for what time period, the next highest bidder will be obligated to acquire the capacity should the winning contingent bidder withdraw its bid;
(j) Any extensions of the minimum posting/bid periods;
(k) Whether Releasing Customer desires to utilize the first-come, first-served option for short-term releases described in Section 6.4.6 below and any minimum terms applicable thereto;
(l) Other special terms and conditions Releasing Customer imposes on the release of its capacity, including, but not limited to, minimum rates, term, and quantity;
(m) Whether to specify dollars and cents or percents of rates in the denomination of bids;
(n) For purposes of bidding and awarding, any minimum rates specified by the Releasing Customer shall include the tariff reservation rate and all reservation surcharges, as a total number or as stated separately;
(o) Whether the release is on a permanent or a temporary basis;
(p) An e-mail address for the Releasing Customer contact person. It is Customer's responsibility to update e-mail address information provided to MS HUB, as necessary; and
(q) The recall notification period(s), as identified in Section 6.4.13(e) below, that will be available for use by the parties.
6.4.2	Intraday Release Quantity. The daily contractual entitlement that can be released by a Releasing Customer for an intraday release is limited to the lesser of:
(a) the quantity contained in the offer submitted by the Releasing Customer; or
(b) a quantity equal to 1/24th of the Releasing Customer's MDIQ and MDWQ for the contract to be released multiplied by the number of hours between the effective time of the release and the end of the Day.
This allocated daily contractual entitlement shall be used for purposes of nominations, billing, and if applicable, for overrun calculations. The MSQ that can be released by a Releasing Customer for an intraday release is limited to a quantity not in excess of the Releasing Customer's MSQ less the Releasing Customer's Storage Inventory.
6.4.3	Posting and Bidding Timeline.	For the Capacity Release business process timing model, only the following methodologies shall be supported by MS HUB and provided to Releasing Customers as choices from which they may select and, once chosen, shall be used in determining the awards from the bid(s) submitted. They are:
(a) highest rate
(b) net revenue
(c) present value
	Other choices of bid evaluation methodology (including other Releasing Customer defined evaluation methodologies) can be accorded similar timeline evaluation treatment at MS HUB's discretion; however, MS HUB is not required to offer other choices or similar timeline treatment for other choices.

	Further, MS HUB shall not be held to the timeline specified in Sections 6.4.3(a) and 6.4.3(b) below should the Releasing Customer elect another method of evaluation. Should the Releasing Customer elect another method of evaluation, the timeline specified in Section 6.4.3(c) below shall apply. The proposed duration of Customer's release determines the minimum bid period for Customer's offer pursuant to this Section 6.4. The Capacity Release timeline is applicable to all parties involved in the Capacity Release process; however, it is only applicable if (i) all information provided by the parties to the transaction is valid and the Replacement Customer has been determined to be creditworthy before the capacity release bid is tendered and (ii) there are no special terms or conditions of the release.	

MS HUB adopts NAESB WGQ Standard 5.3.2 and supports the following Capacity Release timeline (all times are CCT pursuant to NAESB WGQ Standard No. 0.3.17):
	(a)	For biddable releases (1 year or less):
(i) Offers shall be tendered such that they can be posted by 9:00 a.m. on a Business Day;
(ii) Open season ends at 10:00 a.m. on the same or a subsequent Business Day;
(iii) Evaluation period begins at 10:00 a.m. during which contingencies are eliminated, determination of best bid is made, and ties are broken;
(iv) If no match is required, the evaluation period ends and the Award is posted by 11:00 a.m.;
(v) Where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the Award is posted by 12:00 Noon;
(vi) The contract is issued within one hour of the Award posting (with a new contract number, when applicable.)
(vii) Nomination is possible beginning at the next available nomination cycle for the effective date of the contract. 
Such nominations will be processed in accordance with the nomination and scheduling requirements of Section 6.8 (Nominations and Scheduling) of these General Terms and Conditions; however, in no circumstance will Gas flow prior to the effective date of the release as specified in Releasing Customer's offer.
 (b)	For biddable releases (more than 1 year):
(i) Offers shall be tendered such that they can be posted by 9:00 a.m. on a Business Day;
(ii) Open season shall include no less than three 9:00 a.m. to 10:00 a.m. time periods on consecutive Business Days; 
(iii) Evaluation period begins at 10:00 a.m. during which any contingencies are eliminated, determination of best Bid is made, and ties are broken;
(iv) If no match is required, the evaluation period ends and the Award is posted by 11:00 a.m.;
(v) Where match is required, the match is communicated by 11:00 a.m., the match response occurs by 11:30 a.m., and the Award is posted by 12:00 Noon; 
(vi) The contract is issued within one hour of the Award posting (with a new contract number, when applicable); 
(vii) Nomination is possible beginning at the next available nomination cycle for the effective date of the contract. 
Such nominations will be processed in accordance with the nomination and scheduling requirements of Section 6.8 (Nominations and Scheduling) of these General Terms and Conditions; however, in no circumstance will Gas flow prior to the effective date of the release as specified in Releasing Customer's offer.

       (c)	For non-biddable releases:

(i)	The posting of prearranged deals that are not subject to bid are due no later than one hour prior to the nomination deadline for the applicable cycle, pursuant to NAESB WGQ Standard No. 1.3.2. The posting deadlines are:

-	Timely Cycle 12:00 Noon

-	Evening Cycle 5:00 p.m.

-	Intraday 1 Cycle 9:00 a.m.

-	Intraday 2 Cycle 1:30 p.m.

-	Intraday 3 Cycle 6:00 p.m.

	(ii)	The contract is issued within one hour of the Award posting (with a new contract number, when applicable). 
(iii)	Nomination is possible beginning at the next available nomination cycle for the effective date of the contract.
 (d)	Timeline for Non-standard Releases. If Releasing Customer specifies a bid evaluation methodology other than those stated in Section 6.4.7 of these General Terms and Conditions or any special terms or conditions, then the above timelines shall apply; provided, however, one additional Business Day will be added to the evaluation period. Subsequent deadlines will be delayed by such additional Business Day, causing Gas flow to occur at least one Day later than under the standard timelines set forth in Sections 6.4.3(a) and 6.4.3(b) of these General Terms and Conditions.
(e)	Releases Not Subject to Bidding. For proposed capacity releases of a duration of thirty-one (31) Days or less for which Releasing Customer has obtained a Prearranged Replacement Customer and Releasing Customer elects not to post such proposed capacity releases for bidding pursuant to Section 6.4.3 of these General Terms and Conditions and all other terms and conditions of the release are met, Releasing Customer shall notify MS HUB by providing the information pursuant to Section 6.4.1 of these General Terms and Conditions, which information will be posted on MS HUB's Internet Web Site as required by Section 6.4 of these General Terms and Conditions.
	The Prearranged Customer must initiate confirmation of prearranged deals electronically. MS HUB will issue a contract within one hour of notification of the release (with a new contract number, when applicable). Nominations for Gas flow are possible beginning at the next available nomination cycle for the effective date of the contract. Such nominations will be processed in accordance with the nomination and scheduling requirements of Section 6.8 (Nominations and Scheduling) of these General Terms and Conditions; however, in no circumstance will Gas flow prior to the effective date of the release as specified in Releasing Customer's offer. A Prearranged Customer may not consummate a release with any Customer that utilizes the same capacity or overlaps such capacity without such release being subject to the bidding requirement if such Customer has, within the prior twenty-eight (28) consecutive Days, released capacity to such Prearranged Customer, which prior release was not subject to the bidding requirements.
	MS HUB shall post offers and bids, including pre-arranged deals, upon receipt, unless Releasing Customer requests otherwise. If Releasing Customer requests a posting time, MS HUB shall support such request insofar as it comports with the standard timeline. A Releasing Customer cannot specify an extension of the original bid period or the pre-arranged deal match period, without posting a new release.
6.4.4	Pre-arranged Releases.  A Releasing Customer may designate an entity (a pre-arranged designated Replacement Customer) to which it has agreed to release the capacity upon specified terms and conditions. A Releasing Customer's offer to release under such a pre-arranged transaction shall be subject to the prior posting and bidding procedures described in Sections 6.4.5 and 6.4.6 of these General Terms and Conditions.
6.4.5	Posting.  Following receipt of a notice of offer to release capacity which satisfies the requirements set forth in this Section, MS HUB will post such information on its Internet Web Site in accordance with the timeline set forth in Section 6.4.3 herein. MS HUB shall also post offers to purchase capacity from those who desire current Customers to release capacity upon receipt of the applicable information as set forth in this Section.
6.4.6	Bidding and Selection of Replacement Customer. All bids must contain the applicable information required in this Section. If Releasing Customer desires to solicit bids for releases of thirty-one (31) Days or less, it may direct MS HUB to post notice of the availability of such capacity and, in lieu of permitting bids during the otherwise applicable posting period, award the capacity to the bidder who submits first in time a valid bid meeting any minimum terms specified by the Releasing Customer. Any bid submitted by a Replacement Customer shall include an e-mail address for at least one contact person, and it is the Customer's responsibility to update e-mail address information provided to MS HUB, as necessary. A bidder may not have more than one eligible bid for the same release offer at any time. Bids shall be binding unless written or electronic notice of withdrawal is received by MS HUB before the end of the bid period. Bids cannot be withdrawn after the bid period ends. If a bid is withdrawn prior to the end of the bid period, that bidder may only submit a new bid pursuant to that release offer if it is at a higher rate than the withdrawn bid.
	MS HUB shall evaluate the bids in accordance with the provisions of this Section and determine the best bid in accordance with the timelines set forth in Section 6.4.3 of these General Terms and Conditions.

	MS HUB shall notify Releasing Customer, the best bidder, and any prearranged designated Replacement Customer of such determination in accordance with the timelines set forth in Section 6.4.3 of these General Terms and conditions. If there is a pre-arranged designated Replacement Customer, it may exercise its right to match such best bid by providing written notice of such exercise to MS HUB and Releasing Customer in accordance with the timelines set forth in Section 6.4.3 herein.

	After the Replacement Customer is selected, MS HUB and the Replacement Customer will enter into a Firm Storage Service Agreement with respect to the release capacity. Following implementation of the release, MS HUB shall post notice of the winning bidder on its Internet Web Site.

6.4.7	Best Bid. When MS HUB makes awards of capacity for which there have been multiple bids meeting minimum conditions, MS HUB shall award the bids, best bid first, until all offered capacity is awarded. The capacity being awarded represents the MDIQ, MDWQ, or MSQ. These quantities are separate parts of the capacity and are awarded until one of the quantities is fully awarded, at which point all capacity is deemed to be fully awarded. MS HUB shall evaluate and determine the best bid among those otherwise consistent with any terms and conditions specified by the Releasing Customer as follows:
(a) MS HUB shall apply the standard or criteria for such determination specified by the Releasing Customer, including the standard to be used for breaking ties. Any standard or criteria so specified must be objective, economic, not unduly discriminatory, not contrary to applicable provisions of this FERC Gas Tariff, applicable to all potential Replacement Customers and require MS HUB in applying such standard to exercise no more than a ministerial function. The Releasing Customer shall indemnify and hold MS HUB harmless from and against all demands, losses, claims, expenses, causes of action, and/or damages suffered or incurred by MS HUB arising out of or related to any determination of a best bid pursuant to a standard specified, supplied, approved, or provided by Releasing Customer.
(b) If the Releasing Customer does not specify a bid evaluation standard, then MS HUB shall determine the bid or bids generating the highest net present value, using a 10% discount factor, based on the rate bid (reservation component), the applicable quantity(ies) and term or period bid upon. If the Releasing Customer does not specify a method to break ties, priority will be given first to the bid with the shortest term, and next to the bid submitted first in time.
6.4.8	Qualification of Prospective Replacement Customer. A prospective Replacement Customer must be on MS HUB's approved bidders list before bids may be posted on the Internet Web Site, must satisfy all Customer requirements of the applicable Rate Schedule and the General Terms and Conditions of this FERC Gas Tariff. To be on the approved bidders list, the prospective Replacement Customer must satisfy MS HUB's credit requirements as outlined in Section 6.3 (Request for Service) and Section 6.24.7 of these General Terms and Conditions. Such credit appraisal shall be reevaluated and updated every three (3) months. The prospective Replacement Customer shall remain on the approved bidders list until such prospective Replacement Customer (i) notifies MS HUB to the contrary, (ii) no longer meets the credit qualifications established in Section 6.3 (Request for Service) and Section 6.24.7 of these General Terms and Conditions, or (iii) is suspended from the approved bidders list in the event, and for such time as, such Replacement or Prearranged Customer fails to pay part or all of the amount of any bill for service in accordance with Section 6.13 (Billings and Payments) of these General Terms and Conditions. MS HUB will apply its creditworthiness criteria to assess the submission. MS HUB will waive the creditworthiness requirement on a non-discriminatory basis for Replacement Customers and permit them to submit bids, if the Releasing Customer provides MS HUB with a guarantee or other form of credit assurance in form and substance satisfactory to MS HUB of all financial obligations of the Replacement Customer with respect to the capacity being released by Releasing Customer prior to the commencement of service to the Replacement Customer.
6.4.9	Nominations. Following its selection, and prior to the flow of Gas, the Replacement Customer shall be permitted to submit nominations pursuant to the terms and conditions of the applicable Rate Schedule and the General Terms and Conditions of this FERC Gas Tariff.
6.4.10 	Billing. The Replacement Customer shall be billed and make payments to MS HUB in accordance with the applicable Rate Schedule, other provisions of this FERC Gas Tariff, and of its Storage Service Agreement incorporating its bid terms. In accordance with the terms of the release, the Replacement Customer shall pay or be liable for the usage charges (plus all applicable surcharges, Fuel Reimbursement, taxes, penalties, etc.) applicable under the relevant Rate Schedule and Firm Storage Service Agreement attributable to its usage of the released capacity. MS HUB shall continue to bill the Releasing Customer all applicable charges under its existing Storage Service Agreement, excluding usage charges (plus all applicable surcharges, Fuel Reimbursement, taxes, penalties, etc.) billed to the Replacement Customer and attributable to its usage of the released capacity. Invoices sent to the Releasing Customer shall reflect a credit equal to any reservation charges (plus all surcharges applicable thereto) being billed to the Replacement Customer for the released capacity rights, or as otherwise agreed. If the Replacement Customer fails to pay when due all or part of the amounts credited to the Releasing Customer, MS HUB shall pursue payment from the Replacement Customer by notifying such Customer by registered letter, return receipt requested, that it has five (5) days from receipt of such letter to pay the amount due including any applicable interest. If the Replacement Customer fails to pay such amount by the end of the fifth day, MS HUB shall reverse the credit and bill the Releasing Customer for such past due amounts, plus applicable interest.
6.4.11 	Rights and Obligations of the Parties.
(a)	The Storage Service Agreement between the Releasing Customer and MS HUB shall remain in full force and effect with the Releasing Customer to receive a credit to its invoice as described in Section 6.4.10 of these General Terms and Conditions. If the Replacement Customer fails to pay all or part of the amounts credited to the Releasing Customer after the five Day notification period specified in Section 6.4.10 of these General Terms and Conditions, then MS HUB shall reverse the credit and bill the Releasing Customer for such past due amounts, plus applicable interest. The Storage Service Agreement executed by the Replacement Customer shall be fully effective and enforceable by and against the Replacement Customer. The Replacement Customer may also release capacity pursuant to this Section, and in such event and for such purposes, shall be considered the Releasing Customer.
(b)	MS HUB shall accept nominations, schedule service, afford priority of service, and interrupt service based on instructions and communications from the Releasing Customer and the Replacement Customer, which are consistent with one another and with the terms and conditions of MS HUB's FERC Gas Tariff and their respective Storage Service Agreements. In the event that instructions or nominations from the Releasing Customer and Replacement Customer are, in MS HUB's opinion, inconsistent or conflicting, MS HUB shall comply with the instructions of the Releasing Customer; provided, however, that such instructions must not be inconsistent with MS HUB's FERC Gas Tariff or the terms of either the Releasing Customer's or Replacement Customer's Storage Service Agreement, in MS HUB's opinion. The Releasing Customer will indemnify MS HUB against any claim or suit by the Replacement Customer, its successors or assigns, arising from any action taken by MS HUB in reliance upon the Releasing Customer's nominations and instructions and will hold MS HUB harmless for any action taken by MS HUB in reliance upon the nominations and scheduling instructions of the Replacement Customer; provided, however, that the Releasing Customer shall not be liable for the Replacement Customer's failure to pay the usage charges (plus all applicable surcharges, Fuel Reimbursement, taxes, penalties, etc.) billed to the Replacement Customer and attributable to its usage of the released capacity. The Replacement Customer will indemnify MS HUB against any claim or suit by the Releasing Customer, its successors or assigns, arising from any action taken by MS HUB in reliance upon the nominations and scheduling instructions of the Replacement Customer and will hold MS HUB harmless for any actions taken by MS HUB in reliance upon the instructions of the Releasing Customer.
6.4.12 	Marketing Fee.  If MS HUB and the Releasing Customer so agree, MS HUB may receive a negotiated fee for its marketing efforts.
6.4.13 	Limitations
(a)	Releases and assignments hereunder shall be for period(s) of one or more Day(s) and the maximum term shall not extend beyond the expiration of this FERC Gas Tariff provision or beyond the expiration of the Releasing Customer's Storage Service Agreement.
(b) MS HUB may invalidate any offer to release or any bid subsequent to its posting on the Internet Web Site, which does not conform to the requirements of this Section and the other provisions of this FERC Gas Tariff and such invalidated offer or bid shall be deemed null and void.
(c) Any terms and conditions imposed on the offer to release by the Releasing Customer as provided for in this Section must be objectively stated, reasonable, capable of administration or implementation by MS HUB without any material increase in burden or expense, applicable to all potential bidders, not unduly discriminatory, and consistent with the terms and conditions of this FERC Gas Tariff and Releasing Customer's Storage Service Agreement.
(d) A Releasing Customer may re-release to the same Replacement Customer, where such first release was not subject to posting and bidding pursuant to Section 6.4.4 of these General Terms and Conditions, for a term of 31 Days or less, only if: 1) a period of 28 Days has elapsed after the first release for 31 Days or less has expired or 2) the Point(s) of Receipt and/or Point(s) of Delivery for the re-release is different from the Point(s) of Receipt and/or Point(s) of Delivery of the first release or 3) the Releasing Customer causes the posting of an offer to release capacity or of a pre-arranged transaction to be made, and capacity is allocated on the basis of bids submitted.
(e) Recall Provisions. If the Releasing Customer retains recall rights, Releasing Customer's offer to release capacity shall clearly specify the conditions precedent to such recall and whether the recall right retained by Releasing Customer is on a full Day or partial Day basis. The Releasing Customer shall provide capacity recall notification to MS HUB via the Internet Web Site. The recall notification shall specify the recall notification period for the specified effective Day, as well as any other information needed to uniquely identify the capacity being recalled.
MS HUB notices of recalled capacity to all affected Replacement Customers shall be provided via the Internet Web Site, along with written notice via e-mail communication to those Replacement Customer contact person(s) identified in the Replacement Customer's bid submitted pursuant to Section 6.4.6 of these General Terms and Conditions. Such notices shall contain the information required to uniquely identify the capacity being recalled, and shall indicate whether penalties will apply for the Day for which quantities are reduced due to a capacity recall. Upon receipt of notification of the recall from MS HUB, each affected Replacement Customer shall revise its nominations within the applicable nomination cycle in order to implement the recall. Each affected Replacement Customer will be solely responsible for adjusting its supply and transportation arrangements, which may be necessary as a result of such recall.
(f)	Partial Day Recall Quantity. The daily contractual entitlement that can be recalled by a Releasing Customer for a partial Day recall is a quantity equal to the lesser of:
(1) The quantity specified in the Releasing Customer's notice
to recall capacity; or
(2) The difference between the quantity released by the
Releasing Customer and the Elapsed-prorated-scheduled Quantity.

In the recall notification provided to MS HUB by the Releasing Customer, the quantity to be recalled shall be expressed in terms of the adjusted total released capacity entitlements based upon the Elapsed-prorated-scheduled Quantity. In the event of an intraday capacity recall, MS HUB shall determine the allocation of capacity between the Releasing Customer and the Replacement Customer(s) based upon the Elapsed-prorated-scheduled Quantity.

The amount of capacity allocated to the Replacement Customer(s) shall equal the original released quantity less the recalled capacity. This allocated daily contractual quantity shall be used for purposes of nominations, billing, and, if applicable, for overrun calculations. As a result of the allocation of capacity described in this Section, MS HUB shall not be obligated to deliver a combined quantity to the Releasing Customer and the Replacement Customer(s) that is in excess of the total daily contract quantity of the release.
(g) Reput Provisions. MS HUB shall support the function of reputting by the Releasing Customer. The Releasing Customer may reput previously recalled capacity to the Replacement Customer pursuant to the reput rights and methods identified in the Releasing Customer's notice to release capacity, as required by Section 6.4.1(g) of these General Terms and Conditions. When capacity is recalled, such capacity may not be reput for the same Day. The deadline for the Releasing Customer to notify MS HUB of a reput of capacity is 8:00 A.M. CCT to allow the Replacement Customer to submit timely nominations for gas to flow on the next Day.
(h) Following the awarding of capacity to a Replacement Customer in accordance with the procedures provided in this Section, the Releasing Customer's rights and MS HUB's obligations under the Releasing Customer's Storage Service Agreement shall be modified and subject to the capacity rights released and assigned to the Replacement Customer for the term of such release. Effecting a release pursuant to the provisions of this Section shall constitute Releasing Customer's consent and agreement to such amendment or modification of its existing Storage Service Agreement.

6.4.14 	Requests to Purchase Capacity
(a)	Any party desiring to acquire firm capacity pursuant to the capacity release procedures of this Section must submit the following information to MS HUB:  
	(1)	The Replacement Customer's name and contact information;
(2)	The Maximum Storage Quantity, Maximum Daily Injection Quantity and Maximum Daily Withdrawal Quantity for storage service, as applicable;
(3)	The desired commencement date and term of the service;
(4)	The desired primary receipt and delivery points and the associated Maximum Daily Receipt Obligation and Maximum Daily Delivery Obligation for the service;
(5)	The maximum rate(s) that Replacement Customer will pay for the service;
(6)	Whether Replacement Customer will accept a release with recall rights, and if so, what recall rights would be acceptable; and
(7)	Whether Replacement Customer's request is contingent, and if so, the basis for the contingency.

	The foregoing information shall be submitted through Replacement Customer's submittal of a completed Request to Purchase Releasable Capacity Form, which can be found on MS HUB's informational website at http://www.gasnom.com/ip/mississippihub/ 	
	MS HUB will post such information on its informational website for a period of one month or until a transaction is effected, whichever is shorter.
